import { Component, OnInit } from '@angular/core';
import { ShopService } from '../Service/shop.service';
import { Products } from '../Model/products-model';
import { ActivatedRoute, Router } from '@angular/router';


@Component({
  selector: 'app-tienda',
  templateUrl: './tienda.component.html',
  styleUrls: ['./tienda.component.scss']
})
export class TiendaComponent implements OnInit {

  products: Products []

  constructor(private api: ShopService,  private router: Router, private activeRoute: ActivatedRoute) { }

  ngOnInit(): void {
    this.getProducts()
  }

  getProducts(){
    this.api.getProduct().subscribe(data =>{
      this.products = data
    })
  }

}
<div class="main">
    <ul class="cards">
        <li class="cards_item" *ngFor="let product of products">
            <div class="card">
                <div class="card_image"><img class="img" src="{{product.imgproduct}}"></div>
                <div class="card_content">
                    <h2 class="card_title">{{product.nameproduct}}</h2>
                    <p class="card_description"><b>Precio:</b> {{product.priceproduct | currency:'USD'}}</p>
                    <button type="button" routerLink="" class="btn btn-outline-success"><i
                            class="bi bi-cart-plus-fill"></i> Comprar</button>
                </div>
            </div>
        </li>
    </ul>
</div>
